[Form]
public class LedgerJournalTransApproveFetchVouchers extends FormRun
{
    TmpFormLookUp tmpSelection;
    int selectionCount;

}

public void closeCancel()
{
    delete_from tmpSelection;

    selectionCount = 0;

    super();
}

public void closeOk()
{
    if (this.getTotalSelectCount())
    {
        super();
    }
    else
    {
        if (Box::yesNo("@SYS74285", DialogButton::No, "@SYS58698") == DialogButton::Yes)
        {
            this.closeCancel();
        }
    }
}

public Counter getTotalSelectCount()
{
    if (okButton.enabled() != (selectionCount != 0))
    {
        okButton.enabled(selectionCount != 0);
    }

    return selectionCount;
}

display HelpTxt getTotalSelectText()
{
    int totalCount = element.getTotalSelectCount();

    return totalCount ? strfmt("@SYS74283", totalCount) : "@SYS74284";
}

public void init()
{
    // <GCN>
    #isoCountryRegionCodes
    // </GCN>
    tmpSelection = TmpFormLookUp::initOnServer();
    selectionCount = 0;

    super();

    // <GCN>
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoCN])
        && !LedgerParameters::isChineseVoucher_CN())
    {
        sourceList_ds.object(fieldnum(LedgerJournalTrans, Voucher_CN)).visible(false);
        sourceList_ds.object(fieldnum(LedgerJournalTrans, LedgerVoucherType_CN)).visible(false);

        resultList_ds.object(fieldnum(LedgerJournalTrans, Voucher_CN)).visible(false);
        resultList_ds.object(fieldnum(LedgerJournalTrans, LedgerVoucherType_CN)).visible(false);
    }
    // </GCN>
}

void setStandardRanges(Query _query)
{
    QueryBuildDataSource qbds;
    QueryBuildRange qbr;
    LedgerJournalId vendInvoicePoolJournalNum = LedgerJournalTable::findVendorInvoicePool().JournalNum;

    qbds = _query.dataSourceTable(tablenum(LedgerJournalTrans));

    qbr = qbds.addRange(fieldnum(LedgerJournalTrans, JournalNum ));
    qbr.value(queryValue(vendInvoicePoolJournalNum));
    qbr.status(RangeStatus::Hidden);

    qbr = qbds.addRange(fieldnum(LedgerJournalTrans, AccountType));
    qbr.value(queryValue(LedgerJournalACType::Vend));
    qbr.status(RangeStatus::Hidden);

    qbr = qbds.addRange(fieldnum(LedgerJournalTrans, Approved));
    qbr.value(queryValue(NoYes::No));
    qbr.status(RangeStatus::Hidden);

    qbds = qbds.addDataSource(tablenum(LedgerJournalTransAccountView));
    qbds.addLink(fieldnum(LedgerJournalTrans, RecId), fieldnum(LedgerJournalTransAccountView, RecId1));
    qbds.joinMode(JoinMode::ExistsJoin);
    qbds.fetchMode(QueryFetchMode::One2One);

    qbds = qbds.addDataSource(tablenum(VendTrans));
    qbds.joinMode(JoinMode::ExistsJoin);
    qbds.fetchMode(0);

    qbds.addLink(fieldnum(LedgerJournalTransAccountView, AccountNum), fieldnum(VendTrans, AccountNum));
    qbds.addLink(fieldnum(LedgerJournalTransAccountView, Voucher), fieldnum(VendTrans, Voucher));
    qbds.addLink(fieldnum(LedgerJournalTransAccountView, TransDate), fieldnum(VendTrans, TransDate));
    qbds.addLink(fieldnum(LedgerJournalTransAccountView, Invoice), fieldnum(VendTrans, Invoice));

    qbr = qbds.addRange(fieldnum(VendTrans, Arrival));
    qbr.value(queryValue(NoYes::Yes));
    qbr.status(RangeStatus::Hidden);

    qbr = qbds.addRange(fieldnum(VendTrans, JournalNum));
    qbr.value(queryValue(vendInvoicePoolJournalNum));
    qbr.status(RangeStatus::Hidden);
}

