void clicked()
{
    LedgerJournalTrans curRecord,
                       nxtRecord,
                       tmpRecord;

    List markedRecords;
    ListIterator iterator;

    if (! sourceList)
    {
        return;
    }

    //filling internal selection
    tmpRecord = sourceList_ds.getFirst(true);
    if (tmpRecord)
    {
        //Multiple selection performed
        //Current record will be the last selected record
        //Next record not defined
        markedRecords = new List(Types::Record);
        do
        {
            markedRecords.addEnd(tmpRecord);
            tmpSelection.LineNo = tmpRecord.RecId;
            tmpSelection.insert();
            selectionCount++;
            curRecord = tmpRecord.data();
            tmpRecord = sourceList_ds.getNext();
        }
        while (tmpRecord);
    }
    else
    {
        //Just one current record selected
        tmpSelection.LineNo = sourceList.RecId;
        tmpSelection.insert();
        selectionCount++;
        //getting current record in source list
        curRecord = sourceList.data();
        //defining next record in source list
        sourceList_ds.next();
        nxtRecord = sourceList.data();
    }

    //researching and setting active records
    sourceList_ds.research();
    resultList_ds.research();

    if (markedRecords)
    {
        //marking result records
        iterator = new ListIterator(markedRecords);
        while (iterator.more())
        {
            tmpRecord = iterator.value();
            resultList_ds.markRecord(tmpRecord, 1);
            iterator.next();
        }
    }
    else if (nxtRecord)
    {
        //Next record is defined only if multiple selection hasn't been performed.
        //Otherwise next record is the last one in source datasource
        sourceList_ds.positionToRecord(nxtRecord);
    }

    resultList_ds.positionToRecord(curRecord);

    element.getTotalSelectCount();
}

void clicked()
{
    if (!sourceList)
    {
        return;
    }

    sourceList_ds.first();
    do
    {
        tmpSelection.LineNo = sourceList.RecId;
        tmpSelection.insert();
        selectionCount++;
    }
    while (sourceList_ds.next());

    sourceList_ds.research();
    resultList_ds.research();

    element.getTotalSelectCount();
}

void clicked()
{
    LedgerJournalTrans curRecord,
                       prvRecord,
                       tmpRecord;

    List markedRecords;
    ListIterator iterator;

    if (!resultList)
    {
        return;
    }

    //clearing internal selection
    tmpRecord = resultList_ds.getFirst(true);
    if (tmpRecord)
    {
        //Multiple selection performed
        //Current record will be the last selected record
        //Next record not defined
        markedRecords = new List(Types::Record);
        do
        {
            markedRecords.addEnd(tmpRecord);
            delete_from tmpSelection where tmpSelection.LineNo == tmpRecord.RecId;
            selectionCount--;
            curRecord = tmpRecord.data();
            tmpRecord = resultList_ds.getNext();
        }
        while (tmpRecord);
    }
    else
    {
        delete_from tmpSelection
            where tmpSelection.LineNo == resultList.RecId;
        selectionCount--;
        //getting current record id in result list
        curRecord = resultList.data();
        //defining prev record id in result list
        resultList_ds.prev();
        prvRecord = resultList.data();
    }

    //researching and setting active records
    sourceList_ds.research();
    resultList_ds.research();

    if (markedRecords)
    {
        //marking source records
        iterator = new ListIterator(markedRecords);
        while (iterator.more())
        {
            tmpRecord = iterator.value();
            sourceList_ds.markRecord(tmpRecord, 1);
            iterator.next();
        }
    }
    else if (prvRecord)
    {
        //Prev record is defined only if multiple selection hasn't been performed.
        //Otherwise prev record is the first one in result datasource
        resultList_ds.positionToRecord(prvRecord);
    }

    sourceList_ds.positionToRecord(curRecord);

    element.getTotalSelectCount();
}

void clicked()
{
    if (!resultList)
    {
        return;
    }

    resultList_ds.first();
    do
    {
        delete_from tmpSelection where tmpSelection.LineNo == resultList.RecId;

        selectionCount--;
    }
    while (resultList_ds.next());

    sourceList_ds.research();
    resultList_ds.research();

    element.getTotalSelectCount();
}
